import "./Frame3626.css";

function Frame3626(props) {
  const { userName, className } = props;

  return (
    <div className={`frame-3626 ${className || ""}`}>
      <div className="user-name ibmplexsans-semi-bold-monsoon-16px">{userName}</div>
    </div>
  );
}

export default Frame3626;
